INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "青空の下で謁見", 2834, 20063115, 2, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 8, "ペコリーヌとの出会い", 5118061, 0, 7, 91002, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "未来の騎空団\nマスコット？", 2835, 20063115, 2, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 8, "マホとの出会い", 5118062, 0, 7, 91002, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "お嬢さまからの\n緊急依頼", 2837, 20063115, 2, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 8, "アキノとの出会い", 5118063, 0, 7, 91002, 10118, 40, "ランドソル市街地");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "黄金色の悩みごと", 4108402, 20063115, 2, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 8, "ジュンとの出会い", 5118064, 0, 18, 91002, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "白熱！　格闘大会！", 4107402, 20063115, 2, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 8, "カオリとの出会い", 5118065, 0, 18, 91002, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "祭り太鼓はオーエドの華", 9000227, 20063115, 2, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 8, "ニノンとの出会い", 5118066, 1, 16, 91002, 10118, 40, "オーエド町");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "人気者は遅れて\nやってくる", 2101181, 20063115, 3, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 8, "スズナとの出会い", 5118067, 0, 19, 91002, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "巫女・ミーツ・魔法少女", 4109402, 20063115, 3, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 8, "ナナカとの出会い", 5118068, 0, 18, 91002, 10118, 40, "ランドソル市街地");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "ネズ耳は二度なくなる", 4305402, 20063115, 3, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 8, "キャル＆コッコロとの出会い", 5118069, 0, 18, 91002, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "この出会いにカンパイ！", 4101402, 20063115, 3, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 8, "ユカリとの出会い", 5118070, 0, 18, 91002, 10118, 40, "ランドソル市街地");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "陰陽アンサンブル", 4106402, 20063115, 3, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 8, "アオイとの出会い", 5118071, 0, 18, 91002, 10118, 40, "ランドソル市街地");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (1, "運試し十番勝負！", 2836, 20063115, 3, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 8, "シノブとの出会い", 5118072, 1, 7, 91002, 10118, 40, "フリーマーケット会場");
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES (0, "彼女たちの新たな日常", 0, 20063115, 1, 0, 0, "オープニング", 5118600, 0, 0, 0, 10118, 0, 0);
